description:
Fantasy Earth Zero boasts a vast game world that puts epic warfare directly in your hands, emphasizing bristling battle systems, loyalty to friends and defending the player's country against all threats. Fantasy Earth Zero combines fast-paced PvP action, RPG elements, and battle tactics in an ever-changing world.

Fantasy Earth Zero features three distinct classes to choose from, five unique kingdoms vying for a player's allegiance, immersive quests, a stunning soundtrack by Hitoshi Sakimoto (Final Fantasy Tactics, Final Fantasy XII), the pulse-pounding excitement of 50 vs. 50 PvP and a nearly endless array of character customization options. Grab your gear, and get started! &lt;a href=&quot;
